"use strict";

var items = document.querySelectorAll('.cont-img');
var nbSlides = items.length;
var count = 0;

function nextSlide() {
  items[count].classList.remove('active');

  if (count < nbSlides - 1) {
    count++;
  } else {
    count = 0;
  }

  items[count].classList.add('active');
}

setInterval(nextSlide, 10000);
